animal.description:
I am a ten year old senior dog who was adopted in 2018 but just returned when my owner lost her job and could no longer afford to keep me. I get along with the dogs in my foster home. But they are older like me and don't play much. I am easy going. I probably would be happiest with an older adopter who likes the company of a dog who enjoys napping. I am a lap dog, but need help getting up to your lap. I would not do well in a house with stairs or a family with fast moving kids. For a little guy he does have a loud bark that may disturb neighbors in condo or apartment living. Come and meet me at the next adoption show.
Email: dogs@almosthomefoundation.org

Almost Home Foundation's adoption requirements:

(1) Be at least 21 years of age;
(2) Have the consent of all adults living in the household;
(3) Have approval from the residence owner;
(4) Have valid ID with current address;
(5) Be approved by Almost Home Foundation as a suitable adoptive home; and
(6) Live in the Greater Chicago Land area.
7) A copy of your lease (pet page) is required, and submitted with your application

*** Please note that Almost Home Foundation accepts only cash or checks for adoption fees; we do not accept debit or credit cards. ***
